import '../css/home.css'
import Listing from './listing';
import Side from "./side";
function Home () {

    return (
    <div className={'home_wrap'}>
        {Side()}
        <div className={'listing_grid'}>
            {Listing()}
        </div>
        {Side()}
    </div>
    );
}
export default Home;
